CREATE TABLE user_levels (
    user_level_id INTEGER PRIMARY KEY auto_increment,
    user_level_name varchar(30) NOT NULL
);
CREATE TABLE plan_info(user_id INTEGER, plan_id INTEGER, ACTUAL_AMOUNT INTEGER, Discount DECIMAL, FINAL_AMOUNT DECIMAL
);
CREATE TABLE plan_history(
user_id INTEGER,
plan_id INTEGER,
START_DATE DATETIME,
END_DATE DATETIME
);
CREATE TABLE Dept(
dept_id integer PRIMARY KEY,
dept_name varchar(30) NOT NULL,
department_admin INTEGER,
created DATETIME DEFAULT CURRENT_TIMESTAMP,
modified DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE complaints_history(
complaint_id INTEGER,
event_timestamp DATETIME,
status TEXT,
comment TEXT,
assignee INTEGER
);
CREATE TABLE issue_status (
    issue_status_id INTEGER PRIMARY KEY auto_increment,
    status_name varchar(30) NOT NULL
);
CREATE TABLE issue_priorities (
    priority_id INTEGER PRIMARY KEY auto_increment,
    priority_name varchar(30)
);
CREATE TABLE issue_comments (
    comment_id INTEGER PRIMARY KEY auto_increment,
    issue INTEGER NOT NULL,
    commenter INTEGER NOT NULL,
    comment TEXT NOT NULL,
    created DATETIME DEFAULT CURRENT_TIMESTAMP,
    modified DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE zones(id INTEGER PRIMARY KEY auto_increment,name varchar(30),modified DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE plan_cycles(ID INTEGER PRIMARY KEY auto_increment, name varchar(30));
CREATE TABLE issue_types(id INTEGER PRIMARY KEY auto_increment,type varchar(30));
CREATE TABLE user_history
  (
    id INTEGER NOT NULL,
    username varchar(30),
    email varchar(30),
    mobile INTEGER,
    status varchar(30),
    address varchar(30),
    type varchar(30),
    zone INTEGER,
    name varchar(30),
    altMobile varchar(30),
    rate_plan INTEGER,
    plan_cycle INTEGER,
    modifer varchar(30),
    modified_timestamp DATETIME DEFAULT CURRENT_TIMESTAMP,
    sub_status varchar(30),
    account_status varchar(30)
  , amount integer);
CREATE TABLE products (id integer primary key auto_increment,name varchar(30),quantity integer, measurement varchar(30), used_quanity INTEGER, available_quantity INTEGER);
CREATE TABLE work_distribution(eid integer,zone_id integer);
CREATE TABLE plans(plan_id INTEGER PRIMARY KEY auto_increment,
plan_name varchar(30),
speed INTEGER,
FUP INTEGER,
CAPACITY INTEGER,
PRICE INTEGER,
plan_INTERVAL INTEGER
);
CREATE TABLE scheduler_log(last_run_date date,status varchar(30));
CREATE TABLE users (
	id INTEGER NOT NULL, 
	username varchar(30), 
	email varchar(30), 
	password BLOB, 
	department INTEGER, mobile integer, name varchar(30), 
	PRIMARY KEY (id), 
	UNIQUE (username), 
	UNIQUE (email)
);
CREATE TABLE unsettled_balance(user_id integer,due_amount integer,no_of_times integer);
CREATE TABLE recent_inactives(user_id integer,username varchar(30), inactive_date date, portal_inactivated_date date,updated_portal integer);
CREATE TABLE complaint_type(id integer primary key auto_increment,type varchar(30));
CREATE TABLE IF NOT EXISTS "User"
    (
      id INTEGER PRIMARY KEY auto_increment,
      username varchar(30),
      email varchar(30),
      mobile INTEGER,
      status varchar(30),
      address varchar(30),
      type varchar(30),
      zone INTEGER,
      name varchar(30),
      altMobile varchar(30),
      rate_plan INTEGER,
      plan_cycle INTEGER,
      modifer varchar(30),
      actual_amount INTEGER,
      discount_amount INTEGER,
      installation_charge INTEGER,
      modified_timestamp,
      sub_status varchar(30),
      account_status varchar(30),
      creation_date date,
      ip varchar(30),
      aadhar_status integer,
      photo_status integer,
      caf_status integer, billing_date date);
CREATE TABLE balance_info(
  user_id INTEGER,
  paid_amount DECIMAL,
  due_amount DECIMAL,
  due_start_date date,
  last_paid_date date,
  customer_status varchar(30),
  one_interval_amount integer,
  pending_intervals integer);
CREATE TABLE invoices(
   id integer primary key auto_increment,
   user_id integer,
   due_amount integer,
   current_cycle_amount integer,
   user_status varchar(30),
   invoice_date date,
   next_invoice_date date,
   processed integer
 );
CREATE TABLE transactions(
   user_id INTEGER,
   trasaction_id INTEGER PRIMARY KEY auto_increment,
   TIMESTAMP DATETIME DEFAULT CURRENT_TIMESTAMP,
   amount integer,
   payment_type TEXT,
   salesman varchar(30),
   billno varchar(30), payment_receipt_message varchar(30));
CREATE TABLE issues (
        issue_id INTEGER PRIMARY KEY auto_increment,
        Title TEXT,
        department INTEGER,
        assigned_to INTEGER,
        status INTEGER DEFAULT 1,
        priority INTEGER,
        raised_by INTEGER,
issue_type_id INTEGER,
effected_customer_email varchar(30),
effected_customer INTEGER,
comment varchar(30),
commentby INTEGER,
        created DATETIME DEFAULT CURRENT_TIMESTAMP,
        modified DATETIME DEFAULT CURRENT_TIMESTAMP
, description varchar(200), complaint_type varchar(30), new_customer_id varchar(30), customer_message_start varchar(30), assignee_message_start varchar(30), assignee_message_end varchar(30), customer_message_end varchar(30), closed_timestamp datetime);
CREATE TABLE MODES(id integer primary key auto_increment,name varchar(30));
CREATE TABLE reward_points(user_id integer,timestamp datetime,issue_id integer,time_spent integer,reward_points integer);
CREATE TABLE user_latest_info(username varchar(30),plan_cycle integer, actual_amount integer, discount_amount integer, pending_amount integer, billing_from date,name varchar(30), mobile integer,address varchar(30), rate_plan varchar(30));
COMMIT;
